package com.company;

import java.util.Scanner;

public class Main {

    public static void main(String[] args) {
	String k = "";
	Scanner n = new Scanner(System.in);
	String searchValue = n.nextLine();
	char searchValueInChar = searchValue.charAt(0);
	char[] m = k.toCharArray();
	int a = k.length();
	if (searchValue.length() > 1){
		System.out.println("Нужно ввести ровно один символ");
	}
	else {
		for (int i = 0; i < a; i++) {
			if (searchValueInChar == m[i]) {
				System.out.print(i + " ");
			}

		}
	}
    }
}
